    margin-bottom: 32px;
    margin-top: 60px;
    display: flex;

    &__line {
      border: 1px solid $darkFontCl;
      width: 100%;
    }
    @media screen and (min-width: 768px) {
      gap: 16px;
      margin-bottom: 60px;
      font-size: 44px;
    }
    @media screen and (min-width: 1280px) {
      margin-bottom: 80px;
    }
  }
  &__list {
    flex-direction: column;
    gap: 8px;
    margin-bottom: 26px;
    display: flex;

    &__element {
      min-height: 51px;
      width: 100%;
      color: $darkFontCl;
      align-items: center;
      gap: 8px;
      font-size: 14px;
      font-weight: 500;
      line-height: 1.2;
      display: flex;

      @media screen and (min-width: 768px) {
        gap: 20px;
        font-size: 24px;
      }
      @media screen and (min-width: 1280px) {
        width: 978px;
        gap: 56px;
        font-size: 32px;
      }
    }
    &__text {
      width: calc(100% - 48px);
      color: $darkFontCl;
      font-size: 14px;
      font-weight: 500;
      line-height: 1.2;

      @media screen and (min-width: 768px) {
        width: calc(100% - 84px);
        font-size: 24px;
        margin: 0;
      }
      @media screen and (min-width: 1280px) {
        width: calc(100% - 120px);
        font-size: 32px;
      }
    }
    &__number {
      color: $darkFontCl;
      width: 40px;
      height: 40px;
      border: 1px solid $darkFontCl;
      border-radius: 50%;
      justify-content: center;
      align-items: center;
      gap: 8px;
      font-size: 20px;
      font-weight: 500;
      line-height: 1.2;
      display: flex;

      @media screen and (min-width: 768px) {
        width: 64px;
        height: 64px;
        font-size: 24px;
      }
      @media screen and (min-width: 1280px) {
        font-size: 26px;
      }
    }

    @media screen and (min-width: 768px) {
      gap: 20px;
      margin-bottom: 40px;
    }
    @media screen and (min-width: 1280px) {
      gap: 30px;
      margin-bottom: 60px;
      padding: 0 70px;
    }
  }
  &__img {
    margin-left: auto;
    margin-right: auto;
  }
  @media screen and (min-width: 1280px) {
    padding: 0 80px 60px;
  }
}

